INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？", 3001, 12300147, 0, 1, 5, 9, 7, "vo_minigame_1012_result_1079", 2, 1, 4.74);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 3001, 12300148, 0, 1, 5, 9, 1, "vo_minigame_1012_result_1080", 2, 1, 0.0);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 3001, 12300149, 0, 1, 5, 9, 8, "vo_minigame_1012_result_1081", 2, 2, 2.21);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 3001, 12300150, 0, 1, 5, 9, 3, "vo_minigame_1012_result_1082", 2, 2, 2.46);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 3001, 12300151, 0, 1, 5, 9, 3, "vo_minigame_1012_result_1083", 2, 2, 2.94);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 3001, 12300152, 0, 1, 5, 9, 7, "vo_minigame_1012_result_1084", 2, 3, 4.19);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 3001, 12300153, 0, 1, 5, 9, 1, "vo_minigame_1012_result_1085", 2, 3, 0.0);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 3001, 12300154, 0, 1, 5, 9, 3, "vo_minigame_1012_result_1086", 2, 3, 2.63);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 3001, 12300155, 0, 1, 1, 4, 3, "vo_minigame_1012_result_1087", 2, 1, 5.53);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (3, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 3001, 12300156, 9, 1, 1, 4, 3, "vo_minigame_1012_result_1088", 2, 1, 0.01);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 3001, 12300157, 3, 1, 1, 4, 3, "vo_minigame_1012_result_1089", 2, 1, 4.15);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (9, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 3001, 12300158, 9, 1, 1, 4, 9, "vo_minigame_1012_result_1090", 2, 2, 0.01);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (1, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 3001, 12300159, 0, 1, 1, 4, 3, "vo_minigame_1012_result_1091", 2, 2, 5.37);
