INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (3, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 3001, 12300161, 0, 1, 1, 4, 3, "vo_minigame_1012_result_1093", 2, 3, 0.0);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (9, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 3001, 12300162, 3, 1, 1, 4, 3, "vo_minigame_1012_result_1094", 2, 3, 2.91);
