INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (4, "うーん…さっぱり！\nでも簡単な問題なんだよね…？\nもっかいやってみる？", 3001, 22300156, 6, 2, 1, 4, 4, "vo_minigame_1012_result_2088", 2, 1, 0.01);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (3, "うちらまだまだ\nベンキョーちうだし…\nこれからだよねっ？\nね、ヒデサイ！", 3001, 22300157, 0, 2, 1, 4, 0, "vo_minigame_1012_result_2089", 2, 1, 5.28);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (3, "ちょっとずつ覚えれば\nおーけーっしょ！\nうちと一緒に\nベンキョーだね！", 3001, 22300158, 0, 2, 1, 4, 0, "vo_minigame_1012_result_2090", 2, 2, 2.89);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (7, "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？", 3001, 22300159, 0, 2, 1, 4, 0, "vo_minigame_1012_result_2091", 2, 2, 5.45);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (10, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 3001, 22300160, 3, 2, 1, 4, 4, "vo_minigame_1012_result_2092", 2, 2, 4.29);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (8, "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～", 3001, 22300161, 6, 2, 1, 4, 4, "vo_minigame_1012_result_2093", 2, 3, 4.64);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (5, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 3001, 22300162, 0, 2, 1, 4, 9, "vo_minigame_1012_result_2094", 2, 3, 3.14);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (4, "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？", 3001, 22300163, 0, 2, 1, 4, 7, "vo_minigame_1012_result_2095", 2, 3, 6.59);
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (3, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 3001, 22300164, 0, 2, 0, 0, 3, "vo_minigame_1012_result_2096", 2, 1, 0.0);
